g2:c.PROCEDURE.g2:a.TEXT:
_optegrity-auto-package-and-save()

  File, Directory: text;
  option: text = "optegrity-auto-build";
  enabled: truth-value;
  IV: item-or-value; 
  Modu: symbol; 
  Success: truth-value = false;
  GqsModules: sequence = sequence();
  GqsModuleName: symbol;
  MI: class module-information;
  Optegrity-modules: sequence = sequence ();
  OptegrityProductListName: symbol = the symbol opt-internals-workspaces;
  VersionObject: class gfr-version-information-object;
  Pos: integer;
  Len: integer;
  StagePos: integer;
  BuildVersion: text;

begin
  { --- Check if G2 has been started with the auto build }
  enabled = call grtl-command-line-option-specified(option);
  if not(enabled) then return;

  { --- Get target directory, build and save }
  Directory = call grtl-get-command-line-option(option);
  if length-of-text(Directory) = 0 then return;

  Len = length-of-text (Directory);
  Pos = position-of-text ("optegrity-", Directory);
  BuildVersion = get-from-text (Directory, Pos + 10, Len);
  StagePos = position-of-text ("\", BuildVersion);
  if 0 = StagePos then StagePos = position-of-text ("/", BuildVersion);
  BuildVersion = get-from-text (BuildVersion, 1, StagePos - 1);
  post "Build Version = [BuildVersion]";

  for IV = each item-or-value in the item-list named by OptegrityProductListName do
    if the containing-module Modu of IV exists then begin
      Optegrity-modules = insert-at-end (Optegrity-modules, Modu);
{
      if there exists a gfr-version-information-object VersionObject such that (the containing-module of VersionObject = Modu) then begin
        if the gfr-version-description of VersionObject = "" then 
          conclude that the gfr-version-description of VersionObject = "Optegrity [BuildVersion]";
      end;
}
    end;
  end;


  post "Building and saving to [Directory]@.@.@.";

  call gdev-custom-package-and-save( Optegrity-modules, Directory);

  post "Done building.";

  wait for 2 seconds;
  shut down g2;
end

_optegrity-dev-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
  ThisModule: symbol;
  TopModule: symbol; 
  io-init-proc: symbol = the symbol _ioc-from-top-initialization; 
  err: class error;
begin
  TopModule = gfr-get-top-level-module ();
  ThisModule = the containing-module of this procedure;
  if TopModule = ThisModule then
    conclude that grtl-load-completed = TRUE;

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  { --- Start Auto build function } 
  start _optegrity-auto-package-and-save () after 30 seconds;

  if TopModule = ThisModule then begin
    { --- If intelligent objects are loaded initialize them }
    if there exists a procedure named by io-init-proc then
      call the procedure named by io-init-proc();
  end;
 
end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end
